import React from 'react';

const Header = () => {
  const users = [
    { id: 1, initials: 'K', color: 'bg-blue-500' },
    { id: 2, initials: 'S', color: 'bg-green-500' },
    { id: 3, initials: 'M', color: 'bg-purple-500' },
    { id: 4, initials: 'G', color: 'bg-orange-500' },
  ];

  return (
    <div className="bg-white border-b border-gray-200 px-6 py-4">
      <div className="flex items-center justify-between">
        {/* Project title */}
        <div className="flex items-center gap-2">
          <h1 className="text-lg font-semibold text-gray-900">Sample Project</h1>
          <svg className="w-4 h-4 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 10V3L4 14h7v7l9-11h-7z" />
          </svg>
        </div>

        {/* User avatars and actions */}
        <div className="flex items-center gap-4">
          {/* User avatars */}
          <div className="flex items-center gap-1">
            {users.map((user) => (
              <div
                key={user.id}
                className={`w-8 h-8 rounded-full ${user.color} flex items-center justify-center text-white text-sm font-medium`}
              >
                {user.initials}
              </div>
            ))}
            <div className="w-8 h-8 rounded-full bg-gray-200 flex items-center justify-center text-gray-600 text-sm font-medium">
              +8
            </div>
          </div>

          {/* Share button */}
          <button className="px-4 py-2 bg-blue-600 text-white rounded-lg text-sm font-medium hover:bg-blue-700 transition-colors">
            + Share
          </button>

          {/* More options */}
          <button className="p-2 text-gray-400 hover:text-gray-600">
            <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 5v.01M12 12v.01M12 19v.01M12 6a1 1 0 110-2 1 1 0 010 2zm0 7a1 1 0 110-2 1 1 0 010 2zm0 7a1 1 0 110-2 1 1 0 010 2z" />
            </svg>
          </button>
        </div>
      </div>
    </div>
  );
};

export default Header;
